import React, { useState, useEffect } from 'react';
import axios from 'axios';


function Profile() {

    const [data, setData] = useState({hits: [] });

    useEffect(() => {
        const fetchData = async () => {
        const result = await axios(`http://localhost:5000/api/users/profile`);

        setData(result.data);
        };
        fetchData();
    }, []);

        return (  
        <ul>
            {data.hits.map(responseUser => (
                <li key={responseUser.objectID}>
                    <a href={responseUser.url}>{responseUser.title}</a>
                </li>
            ))}

                </ul>
        );
}
export default Profile


